import CountUI from "../../components/Count"
import { connect } from "react-redux"
import { createIncrementAction, createDecrementAction, createIncrementAsynAction } from "../../redux/count_action"
function a (state) {
    return {
        count : state
    }
}

function b (dispatch) {
    return {
        increment : (value) => {
            dispatch(createIncrementAction(value*1))
        },
        decrement : (value) => {
            dispatch(createDecrementAction(value*1))
        },
        incrementAsyn : (value,time) => {
            dispatch(createIncrementAsynAction(value*1,time))
        }

        
    }
}


export default connect(a,b)(CountUI)
